%[text] %[text:anchor:T_9A1D81A9] # **Line Gradient Chart Examples**
%[text] **Overview**
%[text] The `LineGradientChart` manages a line plot which has an associated color gradient. The chart data comprises an increasing `datetime` vector (`XData`) together with a numeric data vector (`YData`). The `YData` is plotted against the `XData` and the color gradient corresponds to the values contained in `YData`. 
%[text] ![LineGradientChart.png](text:image:0538)
%[text] **Documentation**
%[text] - [`surface`](<matlab: doc("surface")>): creates a primitive, three-dimensional surface plot. \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_B0ECD818] ## Create data for the chart: dates and a random walk.
dates = datetime( 1970, 1, 1 ) : datetime( 1980, 1, 1 );
rng( "default" )
steps = [0, randn( size( dates(1:end-1) ) )];
walk = cumsum( steps );
%%
%[text] %[text:anchor:H_92EECAE0] ## Create a figure for the chart.
f = exampleFigure( "Name", "LineGradientChart Example" ); %[output:7c3ce9b9]
%%
%[text] %[text:anchor:H_0131F961] ## Create the chart, specifying the data and figure.
LGC = LineGradientChart( "Parent", f, ...    %[output:group:7b3b7d54] %[output:7c3ce9b9]
    "XData", dates, ... %[output:7c3ce9b9]
    "YData", walk ); %[output:group:7b3b7d54] %[output:7c3ce9b9]
%%
%[text] %[text:anchor:H_49745085] ## Annotate the chart and customize its appearance.
xlabel( LGC, "Date", "FontSize", 14 ) %[output:162a189c]
ylabel( LGC, "Value", "FontSize", 14 ) %[output:162a189c]
title( LGC, "Line Gradient Chart", "FontSize", 16 ) %[output:162a189c]
%%
%[text] %[text:anchor:H_F3BE4FF8] ## Adjust the width of the line.
LGC.LineWidth = 1.5; %[output:8671226f]
%%
%[text] %[text:anchor:H_343EA601] ## Change the colormap.
colormap( LGC, cool() ) %[output:7dd50c5c]
%%
%[text] %[text:anchor:H_DB897F9B] ## Change the x-data of the chart to the first 1000 dates.
LGC.XData = LGC.XData(1:1000); %[output:406b21b0]
%%
%[text] %[text:anchor:H_1E7600B8] ## Change the dates by translating by 10 calendar years.
LGC.XData = LGC.XData + calyears( 10 ); %[output:39fb0882]
%%
%[text] %[text:anchor:H_0D38B564] ## Change the y-data of the chart to a new random walk.
LGC.YData = cumsum( randn( size( LGC.XData ) ) ); %[output:8988dd82]
%%
